INSERT INTO `apps_tos` VALUES (1,'\n<br>\n<h1>\n<span>Conditions of Use for Stalker Application Directory </span>\n</h1>\n\n<br>\n<h3>\n<span>October 1, 2015</span>\n</h3>\n\n<br>\n<h2>\n<span>1. Introduction</span>\n</h2>\n\n<p>\n<span>Stalker Application Directory (hereinafter referred to as the Directory) is an ordered list of applications provided by the application vendors that are available for installation in Middleware Stalker (hereinafter referred to as Stalker).</span>\n</p>\n\n<p>\n<span>The Directory is provided by Infomir, LLC (hereinafter referred to as the Company or we/us), which is located at the following address: 174 Bay 49</span><sup><span>th</span></sup><span> Street, Brooklyn, NY 11214.</span>\n</p>\n\n<p>\n<span>In order to use the Directory it is required that you agree to the following Conditions of Use (hereinafter referred to as the Conditions). Please read them carefully. If any of their provisions are unclear or are unacceptable to you, you may not use the Directory. By starting to use the Directory, you accept the Conditions.</span>\n</p>\n\n<h2>\n<span>2. Directory Use</span>\n</h2>\n\n<p>\n<span><b>Access to the Directory</b>.</span>\n<span> You are granted a non-exclusive, non-transferable license to use the Directory to install/remove the applications to Stalker or other media. The application availability varies by country, and the entire list of applications will possibly not be available in your country.</span>\n</p>\n\n<p>\n<span><b>Applications.</b></span>\n<span>The Company provides a platform in the form of Stalker interface, by which you can at your sole discretion produce a list of applications with those available in the Directory or add/remove an application to the Directory yourself. In connection herewith, all relationships associated with your use of such applications, be it relations with the stakeholders (including, but not limited to, financial relations) or the relationship with the authorities and organizations th